import React from 'react';

function MarketplaceSquares({ cargoListings }) {
  return (
    <div className="flex flex-wrap justify-center">
      {cargoListings.map((listing, index) => (
        <div key={index} className="w-1/4 p-4">
          {/* Display cargo listing information */}
          <h3 className="text-lg font-semibold">Cargo Listing {index + 1}</h3>
          <p>Departure Date: {listing.departureDate}</p>
          <p>Arrival Date: {listing.arrivalDate}</p>
          <p>Cargo Space: {listing.cargoSpace} cubic feet</p>
          {/* You can add more details as needed */}
        </div>
      ))}
    </div>
  );
}

export default MarketplaceSquares;
